import React from 'react';
import {data} from "./store/store.jsx"
import Product from "./components/productcart/Product"
import logo from './logo.svg';
import './App.css';




class App extends React.Component {
    constructor() {
        super();

        this.state = {
            qty: data
        }
    }

    render() {
        return (
            <div>
                {this.state.qty.map(function (el) {
                    return (
                        <div>
                            <Product el={el}/>

                        </div>
                    )
                })}
            </div>
        )
    }


}


export default App;
